import 'bootstrap/dist/css/bootstrap.min.css';
import { React} from 'react';
import './App.css'
import GridExample from './omsOrderComponent/GridExample';

function App() {
    return (
      <div >
        <BrowserRouter>
          <Routes>
              <Route></Route>
              <Route exact path="/GridExample" element={<GridExample/>} />
          </Routes>
    </BrowserRouter>



      </div>
    );
  }
  export default App;
